const currencyPicker = document.querySelector(".currencyPicker")
let picker = true

const handlePickerVisibility = () => {
    if(choosenChartType === "forex") {
        currencyPicker.style.display = 'none'
        picker = false
    } else {
        currencyPicker.style.display = 'block'
        picker = true
    }
}


